import dateTimeFormat from "./funcDateTimeFormat"

function rangeHours() {
  const date = new Date()

  let arrHours = []

  for (let i = 1; i <= 84; i++) {
    if (i <= 12) {
      arrHours.push(
        <div className="hours"   date={dateTimeFormat(1)} key={i}>
          {i + 9}
        </div>
      )
    }
    if (12 < i && i <= 24) {
      arrHours.push(
        <div className="hours" date={dateTimeFormat(2)} key={i}>
          {i - 3}
        </div>
      )
    }
    if (24 < i && i <= 36) {
      arrHours.push(
        <div className="hours" date={dateTimeFormat(3)} key={i}>
          {i - 15}
        </div>
      )
    }
    if (36 < i && i <= 48) {
      arrHours.push(
        <div className="hours" date={dateTimeFormat(4)} key={i}>
          {i - 27}
        </div>
      )
    }
    if (48 < i && i <= 60) {
      arrHours.push(
        <div className="hours" date={dateTimeFormat(5)} key={i}>
          {i - 39}{" "}
        </div>
      )
    }
    if (60 < i && i <= 72) {
      arrHours.push(
        <div className="hours" date={dateTimeFormat(6)} key={i}>
          {i - 51}{" "}
        </div>
      )
    }
    if (72 < i && i <= 84) {
      arrHours.push(
        <div className="hours" date={dateTimeFormat(7)} key={i}>
          {i - 63}{" "}
        </div>
      )
    }
  }

  return arrHours
}

export default rangeHours
